import styled from "styled-components";

export const inputBox = styled.div`
  display: flex;
  flex-direction: row;
`;

export const input = styled.input`
  border: 1px solid #d9d9d9;
  border-radius: 4px;
  box-sizing: border-box;
  width: 150px;
  height: 54px;
`;

export const button = styled.button`

`
